webpackJsonp([37361545465934],{1216:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/improving-your-website-with-nibbler/index.md absPath of file >>> MarkdownRemark",html:'<p><img src="/content/images/2011/11/love-nibbler.png" title="I love Nibbler"></p>\n<p>If you haven\'t encountered <a href="http://nibbler.silktide.com/" title="Visit the Nibbler website.">Nibbler</a> before, Nibbler is a free-to-use website quality checker.  It\'s developed and maintained by <a href="http://www.silktide.com/">Silktide</a>, and is a tool for checking up to 5 pages of a website against 20 different quality checks - from Social Media to W3C compliance, Alternative text to Semantic HTML.</p>\n<p>You can test any website - be it your own or a competitors\' website, and you\'ll get the results from of a wide range of tests returned to you with both a grade, from 0.0  to a perfect 10, along with some background information and suggestions for improvement. Pretty neat, eh?</p>\n<p><a href="http://nibbler.silktide.com/reports/www.psyked.co.uk">See how well Psyked.co.uk does on Nibbler.</a></p>',frontmatter:{title:"Improving your website with Nibbler",date:"November 14, 2011",tags:["external-links","html","nibbler","validation"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/hacking-facebook-like-buttons-for-w3c-validation-in-html5/",tags:["facebook","html","html5","hacks","validation"],title:'Hacking Facebook "Like" buttons for W3C Validation in HTML5',date:"2011-11-11T00:11:03.000Z"}},next:{frontmatter:{path:"/blog/corona-sdk-solving-json-decode-error-with-utf-8-files/",tags:["encoding"],title:"Corona SDK: Solving JSON decode error with UTF-8 files.",date:"2011-11-14T21:41:45.000Z"}}}}}});
